import React from 'react';
import {withTheme} from '@material-ui/core/styles';
import {connect} from "react-redux";

import Layout from "../_layouts/default/Layout";
import BoxList from "./BoxList";

function HomePage(props) {
    const {pageCaption, images} = props

    return (
        <Layout pageCaption={pageCaption} drawered={false}>
            <BoxList images={images}/>
        </Layout>
    );
}

const mapStateToProps = (state) => {
    return {
        images: state.homePage.images,
        pageCaption: state.homePage.pageCaption,
    }
}

export default connect(mapStateToProps)(
    withTheme(HomePage)
)
